  [],\n\t\"revision_timestamp\": \"2016-07-27T22:21:12.498139\",\n\t\"name\": \"ruby-lake-national-wildlife-refuge-ruby-valley-nevada-1996-annual-water-management-report-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Overall, 1996 was a very wet year with
  21.48 inches of precipitation recorded at Refuge headquarters. Near or above average
  precipitation has occurred during four of the last five years. Above average spring
  flows occurred during the year. The South Marsh reached objective level on 15 January
  and by the end of the year was 6.36 inches above objective level (5965.28). The
  water availability forecast for 1997 is very encouraging. The early part of winter
  was mild and wet, with above average amounts of precipitation falling during October
  through January. The snow pack water content in the south Ruby Mountains as of 1
  February was 141.3 percent of average. As of 5 February the elevation of the South
  Marsh was 5965.64 which is 10.68 inches above objective level. It is expected that
  there will be water available to maintain objective elevations in the West Marsh
  Units, the South Marsh, and the North Marsh.\",\n\t\"license_title\": \"License
